import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getListUtilityClass(slot) {
  return generateUtilityClass('JoyList', slot);
}
const listClasses = generateUtilityClasses('JoyList', ['root', 'nesting', 'row', 'scoped', 'sizeSm', 'sizeMd', 'sizeLg', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantOutlined', 'variantSoft', 'variantSolid']);
export default listClasses;
